import React from 'react';
import { Link } from 'react-router-dom';
import ProjectBox from './ProjectBox';
import './home.css';

const Home = () => {
  return (
    <div>
      <header>
        <nav>
          <ul>
            <li><Link to="/portfolio">Home</Link></li>
            <li><Link to="/cv">CV</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/contact">Contact</Link></li>
          </ul>
        </nav>
      </header>
      <div className="main-container">
        <div className="hero-text">
          <h1>Dale Warburton</h1>
          <h2>Welcome to my portfolio site,</h2>
          <h3>I am a junior full-stack developer with a passion for cloud.</h3>
        </div>
        <div className="projects-container">
          <h2>Recent projects & Articles</h2>
          <Link to="/projects/python-event-planner">
            <ProjectBox title="Python Event Planner" />
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Home;
